import React, {Component} from 'react'

class UserDetails extends Component{
    render(){
        return <ul>
                <li>Persons First Name</li>
                <li>Persons First Name</li>
                <li>Persons Last Name</li>
                <li>Persons Email</li>
               </ul>
    }
}

export default UserDetails
